(def neko 
  (-> "resources/images/cat.jpg" 
      imread  
      (u/resize-by 0.2)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;voiceless-drylands/neko</span>","value":"#'voiceless-drylands/neko"}
