;; **
;;; ## prewitt-horizontal
;; **

;; @@
(defn apply-my-filter 
  ([ mat my-filter] 
   (apply-my-filter mat my-filter false))
  ([ mat my-filter invert]
  (->
  mat 
  clone
  (cvt-color! COLOR_RGB2GRAY)
  (filter-2-d! -1 (u/matrix-to-mat my-filter))
  ((fn [x] (if invert (bitwise-not! x) x)))
  (u/mat-view ))))

(apply-my-filter neko
     [ [-1 -1 -1]
       [0 0 0]
       [1 1 1]] true)
