; sobel vertical-matrix
(->
  (imread "resources/images/cat.jpg")
  (cvt-color! COLOR_RGB2GRAY)
  (filter-2-d! -1 (u/matrix-to-mat
    [ [-1 0 1]
      [-2 0 2]
      [-1 0 1]]))
  (imwrite "output/cat3.png"))

